INSERT INTO `bb_action` VALUES (1,'SUSPEND_SUBSCRIBER_PLAN','UPDATE bb_subscriber_plan SET plan_state = \'SUSPENDED\' WHERE subscriber_id = \'%{BB-Subscriber-Id}\'','DB'),(2,'DISCONNECT_SUBSCRIBER','INSERT IGNORE INTO bb_pod_event (session_id, username) VALUES (\'%{Acct-Session-Id}\',\'%{User-Name}\')','DB'),(3,'THROTTLE_SUBSCRIBER_PLAN','UPDATE bb_subscriber_plan SET plan_state = \'THROTTLED\' WHERE subscriber_id = \'%{BB-Subscriber-Id}\'','DB'),(4,'COA_SUBSCRIBER','INSERT IGNORE INTO bb_coa_event (session_id, username) VALUES (\'%{Acct-Session-Id}\',\'%{User-Name}\')','DB'),(5,'SUSPEND_SECONDARY_PLANS','UPDATE bb_subscriber_plan set plan_state = \'SUSPENDED\'\nWHERE subscriber_id IN (\n    SELECT a.subscriber_id FROM bb_subscriber_link_association a\n        JOIN bb_subscriber b ON a.subscriber_id = b.subscriber_id\n    WHERE link_id in (SELECT id FROM bb_subscriber_link WHERE link_name = \'%{User-Name}\')\n)','DB'),(6,'DISCONNECT_SECONDARY_SUBSCRIBERS','INSERT IGNORE INTO bb_pod_event (session_id,username,request_datetime) (\n    SELECT b.session_id,b.user_name, NOW() FROM bb_subscriber_link_association a\n        JOIN bb_subscriber_session b ON a.subscriber_id = b.subscriber_id\n    WHERE link_id in (SELECT id FROM bb_subscriber_link WHERE link_name = \'%{User-Name}\')\n)','DB'),(7,'THROTTLE_SEONDARY_SUBSCRIBERS','UPDATE bb_subscriber_plan set plan_state = \'THROTTLED\'\nWHERE subscriber_id IN (\n    SELECT a.subscriber_id FROM bb_subscriber_link_association a\n        JOIN bb_subscriber b ON a.subscriber_id = b.subscriber_id\n    WHERE link_id in (SELECT id FROM bb_subscriber_link WHERE link_name = \'%{User-Name}\')\n)','DB'),(8,'COA_SECONDARY_SUBSCRIBERS','INSERT IGNORE INTO bb_coa_event (session_id,username,request_datetime) (\n    SELECT b.session_id,b.user_name, NOW() FROM bb_subscriber_link_association a\n        JOIN bb_subscriber_session b ON a.subscriber_id = b.subscriber_id\n    WHERE link_id in (SELECT id FROM bb_subscriber_link WHERE link_name = \'%{User-Name}\')\n)','DB'),(9,'SUSPEND_PRIMARY_PLAN','UPDATE bb_subscriber_plan set plan_state = \'SUSPENDED\'\n    WHERE subscriber_id IN (\n    SELECT a.primary_subscriber_id FROM bb_subscriber_link a\n        JOIN bb_subscriber b ON a.primary_subscriber_id = b.subscriber_id\n    WHERE a.id in (SELECT link_id FROM bb_subscriber_link_association c  WHERE c.subscriber_id = %{BB-Subscriber-Id})\n)','DB'),(10,'DISCONNECT_PRIMARY_SUBSCRIBER','INSERT IGNORE INTO bb_pod_event (session_id,username,request_datetime)(\n    SELECT b.session_id,b.user_name, NOW()\n        FROM bb_subscriber_link a\n        JOIN bb_subscriber_session b ON a.primary_subscriber_id = b.subscriber_id\n    WHERE a.id IN (SELECT link_id FROM bb_subscriber_link_association c  WHERE c.subscriber_id = %{BB-Subscriber-Id})\n)','DB');
