CREATE DEFINER=`radius`@`%` FUNCTION `getTotalAllocation`(subscriberID int) RETURNS bigint(65)
    READS SQL DATA
BEGIN
    DECLARE planId INT;
    DECLARE maxDataQuota BIGINT(65) DEFAULT 0;
    DECLARE dataBundle BIGINT(65) DEFAULT 0;
    DECLARE rolloverQuota BIGINT(65) DEFAULT 0;
    DECLARE total BIGINT(65) DEFAULT 0;


    SELECT p.plan_id INTO planId
    FROM bb_subscriber_plan p
    WHERE p.subscriber_id = subscriberID;

    SELECT COALESCE(parameter_value*1048576,0) INTO maxDataQuota
    FROM bb_plan_parameter_subscriber_override o
    WHERE o.subscriber_id = subscriberID
      AND o.plan_id = planId
      AND o.parameter_name = 'MAX_DATA_QUOTA_MB';

    IF maxDataQuota = 0 THEN
        SELECT COALESCE(parameter_value*1048576,0) INTO maxDataQuota
        FROM bb_plan_parameter p
        WHERE p.plan_id = planId
          AND parameter_name = 'MAX_DATA_QUOTA_MB';
    END IF;

    SELECT COALESCE(d.data_allowance*1048576,0) INTO dataBundle
    FROM bb_subscriber_data_bundle b, bb_data_bundle d
    WHERE b.valid_till > CURRENT_TIMESTAMP
      AND b.subscriber_id = subscriberID
      AND b.bundle_id = d.data_bundle_id;

    SELECT COALESCE(r.rollover_quota_bytes,0) INTO rolloverQuota
    FROM bb_subscriber_data_rollover r
    WHERE r.valid_till > CURRENT_TIMESTAMP
      AND r.subscriber_id = subscriberID;

    SET total = maxDataQuota + dataBundle + rolloverQuota;

    RETURN total;
END ;;
DELIMITER ;
